import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the 'View All →' link to be visible
    await page.waitForSelector('a.view-all-link');

    // Click the 'View All →' link
    await page.click('a.view-all-link');

    // Wait for the dashboard page to load
    await page.waitForLoadState('networkidle');

    // Take a screenshot after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_click.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_click.png'));

    // Verify navigation by checking the URL or a specific element on the dashboard
    const currentUrl = page.url();
    const dashboardLoaded = await page.waitForSelector('h2.hero-title'); // Assuming the dashboard has a title

    return {
      success: true,
      action: "Clicked 'View All →' link and navigated to the dashboard",
      extractedData: {
        currentUrl,
        dashboardLoaded: dashboardLoaded ? true : false
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

